 <p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>单个处理方式有：确认缺货、继续采购、换供采购</span><ul><li><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>只允许对处理状态为未处理的数据进行处理；否则弹出提醒”该数据已处理，不可重复处理“</span></ul><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>1.确认缺货</span><ul><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>此时若在途数量之和小于订单需求待配单数量，则取消用户订单需求&amp;nbsp; </span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>此时若在途数量之和大于等于订单需求待配单数量，则不做处理</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>操作成功后，该数据处理状态变更为已处理，处理方式为确认缺货</span></ul><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'><br></span></p>

 <p><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>处理方式有：批量确认缺货、批量继续采购、批量换供采购</span><ul><li><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>只允许单个供应商进行批量处理；若非同个供应商，则提醒“只允许同个供应商的数据进行批量处理”</span><li><span style='font-family:&quot;Arial Negreta&quot;,&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:700'>只允许对处理状态为未处理的数据进行处理；否则弹出提醒”该数据已处理，不可重复处理“</span></ul><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>1.批量确认缺货</span><ul><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>此时若在途数量之和小于订单需求待配单数量，则取消用户订单需求&amp;nbsp; </span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>此时若在途数量之和大于等于订单需求待配单数量，则不做处理</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>操作成功后，该数据处理状态变更为已处理，处理方式为确认缺货</span></ul><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>2.批量继续采购</span><ul><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>选择继续采购，则展示采购数量字段，采购数量按照缺货数量读取展示，不可修改</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>该功能为向原采购单释放申请缺货数量至待采数量</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>操作成功后，该数据处理状态变更为已处理，处理方式为继续采购</span></ul><p><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>3.批量换供采购</span><ul><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>换供采购只允许同个GOODS进行操作；若非同个GOODS则提醒“只允许同个GOODS进行批量换供采购”</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>向一品多供的其他供应商推送此需求（第二个供应商），同个供应商、同原采购单所有缺货商品生成一个缺货审核单，数量为对应的缺货数量。</span><li><span style='font-family:&quot;Arial Normal&quot;,&quot;Arial&quot;,sans-serif;font-weight:400'>操作成功后，该数据处理状态变更为已处理，处理方式为换供采购</span></ul>
 </div>

 <p><span>1.WMS-采购-供应商管理-编辑新增7种采购单提交缺货的时间字段；下拉选项，可选1-30天；都为必填项，需要有必填校验</span><p><span>2.各自段默认值如下</span><ul><li><span>按需采购自动缺货时间&amp;nbsp;&amp;nbsp; 3天</span><li><span>备货采购自动缺货时间&amp;nbsp;&amp;nbsp; 7天</span><li><span>滚动采购自动缺货时间&amp;nbsp;&amp;nbsp; 3天</span><li><span>寄售采购自动缺货时间&amp;nbsp;&amp;nbsp; 7天</span><li><span>调样采购自动缺货时间&amp;nbsp;&amp;nbsp; 3天</span><li><span>异常入库自动缺货时间&amp;nbsp; 3天</span><li><span>做货款采购自动缺货时间&amp;nbsp; 15天</span></ul><p><span>3.对应类型的采购单下商品，根据当前时间-采购单生成时间&amp;gt;自动缺货时间，则将商品自动推送至缺货审核管理。一个采购单、一个SKU生成一个缺货审核单，缺货审核单添加人为admin</span><p><span><br></span></p>

 <div id=u632_text class=text>
 <p><span>3.继续采购</span><ul><li><span>选择继续采购，则展示采购数量字段，采购数量按照缺货数量读取展示，不可修改</span><li><span>该功能为向原采购单释放申请缺货数量至待采数量</span><li><span>操作成功后，该数据处理状态变更为已处理，处理方式为继续采购</span></ul>
 </div>
 </div>
 
 <div id=u633 class=&quot;ax_default _段落&quot;>
 <div id=u633_div></div>
 <div id=u633_text class=text>
 <p><span><br></span><p><span>2.换供采购</span><ul><li><span>选择换供采购，则供应商1、采购数量1为必填项，需要有必填校验；点击+，可以新增供应商2、采购数量2，为非必填项；供应商1、供应商2为该GOODS配置的其他供应商</span><li><span>向一品多供的其他供应商推送此需求，最多支持两个供应商同时进行采购；若总采购量小于或缺货数量，则提交失败，弹出提醒“总采购数量不等于缺货数量，提交失败”</span><li><span>同个供应商、同原采购单同时操作的所有缺货商品生成一个缺货采购单，数量为对应的缺货数量。</span><li><span>操作成功后，该数据处理状态变更为已处理，处理方式为换供采购</span></ul>
 </div>
 </div>
